Список скиллов::
- web: html,php,js,ajax,css,mysql;
- Фреймворки для проектирования в Web: Yii2, jQuery, Bootstrap, Laravel;
- другие языки: bash(легкие скрипты для backup, скрипты для разбора логов и создания конфигов), VBS, VBA(Макросы в doc,xls), C++(Проектировал платы и консольные приложения);
- Проектирование: Построение алгоритмов, Графиков (ERP,IDEF, Диаграммы Ганта), Построение БД и их связей (MySQL Workbench);
- Администрирование серверов (Win/Linux);
